class FunctionQueue:
    def __init__(self, dict_: dict = None):
        self.__connects = dict_ or dict()

    def __iter__(self):
        for func in self.__connects:
            yield func

    def __getitem__(self, item):
        return self.__connects[item]

    @property
    def queue(self):
        return self.__connects

    def append(self, value):
        self.__connects[len(self.__connects)] = value


class Observer:

    init_queue = FunctionQueue

    def __init__(self):
        self.__queue = self.init_queue()

    def connect(self, func):
        self.__queue.append(func)
        return func

    def send(self, *args, **kws):
        for func in self.__queue:
            func(*args, **kws)

    def print(self):
        print(self.__queue.queue)


class Before(Observer):
    """"""


class After(Observer):
    """"""


class ObserverManager:

    def __getitem__(self, item):
        return self.__dict__[item]

    @classmethod
    def init(cls):
        """"""
        instance = cls()
        for obs in Observer.__subclasses__():
            setattr(instance, obs.__name__.lower(), obs())
        return instance


